  "handle": "dash-dog-reversible-mat",
  "description": "<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Going camping? Add Plan to your adventures.</span></p>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Dash Dog On-The-Go Reversible dog mat is created so your dog can doze off comfortably, even outdoors. It is lightweight, reversible and water repellent. </span><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Made of taffeta fabric, this mat has bone shaped quilted patterns (how cool is that!).</span></p>\n<p><span style=\"font-weight: 400;\">It is comfortable for both you and your dog: polyfill filling inside makes it cosy for your pet, and the handle makes it easy for you to carry.<span> </span></span><span style=\"font-weight: 400;\">Reflective straps which helps in the  visibility during the night.</span></p>\n<p><b>Pack it in 10 seconds</b></p>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Just fold it once and use the belts to snap it shut. Carry and store it anywhere.</span></p>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">Features:</b></p>\n<ul data-mce-fragment=\"1\">\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Reversible on-the-go dog mat</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Lightweight and comfy</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Perfect for hikes and camping</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Pack it in 10 secs</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Water repellent</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Padded for extra comfort</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Recycled polyester fiber filling</span></li>\n<li style=\"font-weight: 400;\"><span>Handle and fastening belt, with reflective strap</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Bone shaped quilted patterns</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">100% happy naps</span></li>\n</ul>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">Wash Care:</b></p>\n<ul data-mce-fragment=\"1\">\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Machine wash cold with a gentle cycle.</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Do not bleach</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Do not tumble dry</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Do not dry clean</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Do not iron</span></li>\n</ul>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><b>DD Reminder: </b>Naps are super important for all dogs. Make sure they get ample rest before they head out to chase fun.</span></p>",
