  "description": "<p><i><span style=\"font-weight: 400;\">Made for dogs who go with the flow; exploring paths and chasing rainbows!</span></i></p>\n<p><span style=\"font-weight: 400;\">Vibrant and sturdy, Dash Dog Rainbow Dog Bowl is made for your dog to paint the town red, blue, pink and yellow! The double-wall stainless steel makes it tough and strong. The anti-skid silicone base makes it stay put, no matter what surface you keep it on. The bowl has a beautiful rainbow gradient complete with a Dash Dog logo.</span></p>\n<p><span style=\"font-weight: 400;\">So go on - add a splash of fun to your dog’s bowl.</span></p>\n<p><b>Features:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Double-walled stainless steel bowl</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Rainbow gradient finish</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Durable and strong</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Perfect for travel or everyday use</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Crafted with food-safe colour</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Anti-skid silicone base</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Superior finish</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">100% fun</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Capacity-M-1200 ml, L-1900 ml</span></li>\n</ul>\n<p><b>Wash Care:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wash in the dishwasher or hand wash with mild detergent. Air dry in shade.</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Clean the outer bowl with damp cloth or hand wash with mild detergent.</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not scrub to avoid scratches.</span></li>\n</ul>\n<p><b>DD Reminder:</b><span style=\"font-weight: 400;\"> Have the perfect afternoon with your dog.</span></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Fill up your tummies with food and fun</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Dash outside for some fresh air</span></li>\n</ul>",
