  "description": "<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Get, set, flow. This harness is made of air mesh fabric which makes it extremely lightweight. Click the buckles close and adjust the harness at neck and girth. Attach your favourite </span><strong>DD leash</strong><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"> to the harness and head out to chase the sun</span></p>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">Features:</b></p>\n<ul data-mce-fragment=\"1\">\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Vibrant printed dog harness</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Adjustable at neck &amp; girth</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made of breathable air mesh fabric</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Quick snap buckles for ease of wear</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Adjust to your pet’s comfort</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">V ring leash attachment at back</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">ID tag ring in the front</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Reflective strips at the bottom</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Features signature DD violet colour</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\"><span>Rainbow chrome plating hardware</span></span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">100% fun walks</span></li>\n</ul>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">Wash Care:</b><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"> Gently hand wash using mild detergent. Air dry in shade.</span><br></p>\n<p data-mce-fragment=\"1\"><b>DD Reminder: </b><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">V ring at the back is for the leash attachment; the ones in the front are for ID tags. Don’t mix the two up before you lose yourself to fun.</span></p>",
