  "title": "Dash Dog Zigzag Boulder Fetch Dog Toy - Navy/Red",
  "handle": "dash-dog-zigzag-fetch-dog-toy",
  "description": "<p><span style=\"font-weight: 400;\">Dive into fun with Dash Dog Zigzag Boulder fetch toy. Its fantastic 3D design in sporty, bold colours makes this toy one of a kind. Strong, light and floatable, it is perfect for the beach, swimming pools or bath tubs.</span></p>\n<p><span style=\"font-weight: 400;\">So go on, dash outside and let's chase fun!</span></p>\n<p><b>How does it float?</b></p>\n<p><span style=\"font-weight: 400;\">The toy is made of grainy polyester fabric coated with PVC/PU. It's stuffed with recycled polyester staple fiber. Polyester tape on the edges gives it extra reinforcement - making the toy durable and tough. </span><span style=\"font-weight: 400;\">Its functional construction together with the stuffing makes the toy float on water.</span><br></p>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">Features:</b></p>\n<ul data-mce-fragment=\"1\">\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">3D fetch toy for active dogs</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Water resistant and floats on water</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Perfect for outdoor and water play</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Strong, durable and functional</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Double stitched on edges</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Double reinforced material</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Designed for ease of play - for both human and dog</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">100% fun</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Size: 20 x 8 x 9cm / 7.8 x 3.1 x 3.5inch</span></li>\n</ul>\n<ul data-mce-fragment=\"1\"></ul>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">Wash Care: </b>Hand wash with cold or room temperature water. Air dry in shade. Do not tumble dry.</p>\n<p data-mce-fragment=\"1\"><b>DD Reminder: <span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Head out with your dog and do what floats your boat.</span></b></p>",
