  "description": "<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Tired after a game of fetch? Sip on something cool in this even cooler bowl.</span></p>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">The double-wall stainless steel makes it tough and strong. The anti-skid silicone base makes it stay put, no matter what surface you keep it on. The slanted top is specially designed for flat faced dogs and dogs with long ears.</span></p>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">So go on - add a splash of fun to your dog’s bowl.</span></p>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">Features:</b></p>\n<ul data-mce-fragment=\"1\">\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Double-walled stainless steel bowl</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Durable and strong</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Slanted design for flat faced dogs &amp; dogs with long ears</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Perfect for travel or everyday use</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Crafted with food safe colour</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Anti-skid silicone base</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Superior finish</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Features signature DD violet colour</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">100% fun</span></li>\n</ul>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">Wash Care:</b></p>\n<ul data-mce-fragment=\"1\">\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Wash in the dishwasher or hand wash with mild detergent. Air dry in shade.</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Clean the outer bowl with damp cloth or hand wash with mild detergent.</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not scrub to avoid scratches.</span></li>\n</ul>\n<p><span style=\"font-weight: 400;\"><b>DD Reminder: </b>The smaller size is great for puppies as well. </span></p>\n<p><span style=\"font-weight: 400;\">Have the perfect afternoon with your dog</span></p>\n<ol>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Fill up your tummies with food and fun.</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Dash outside for some fresh air.</span></li>\n</ol>",
