  "id": 7149896859710,
  "title": "Dash Dog Zoom Walk Along Harness - Violet & Red",
  "handle": "dash-dog-lightweight-harness",
  "description": "<p><span style=\"font-weight: 400;\">Zoom out to have some fun. This harness is lightweight and resistant to rip and tear. Reflective threads and piping help with visibility at night. The handle at the back lets you have more control over your dog’s movement.</span></p>\n<p><span style=\"font-weight: 400;\">Just click the buckles shut, attach your favourite </span><strong>DD leash</strong><span style=\"font-weight: 400;\"> to the harness and head out to chase the sun</span></p>\n<p><b>What’s more?</b></p>\n<p><span style=\"font-weight: 400;\">This harness can be adjusted at 4 different points. That is 4 times the comfort for your dog.</span></p>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">Features:</b></p>\n<ul data-mce-fragment=\"1\">\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Strong, durable and lightweight dog harness</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made of ripstop fabric to avoid rip and tear</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Breathable air mesh fabric makes it lightweight</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Reflective piping &amp; threads for visibility at night</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Handle at back for control over dog’s movement</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Lockable buckles at neck for safe closure</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Adjustable at 4 points for the perfect fit</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">V ring at back for leash attachment</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">V ring at front for ID tag - also works as no-pull harness</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\"><span>Rainbow chrome plating hardware</span></span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">100% fun walks</span></li>\n</ul>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">Wash Care:</b><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"> Gently hand wash using mild detergent. Air dry in shade.</span><br></p>\n<p data-mce-fragment=\"1\"><b>DD Reminder: </b><span style=\"font-weight: 400;\">V ring at the back is for the leash attachment; the ones in the front are for ID tags. Don’t mix the two up before you lose yourself to fun.</span></p>",
