  "description": "<p><span style=\"font-weight: 400;\">The KING of fun is here with Dash Dog Wild Lion comfort toy. It is soft, textured and the perfect nap buddy. They will enjoy interacting with the squeaker all day long. </span></p>\n<p><b>Why choose the Wild Lion?</b></p>\n<p><span style=\"font-weight: 400;\">We’ve made cuddle toys stronger. It’s made with poly sherpa material with recycled polyfill filling. </span><span style=\"font-weight: 400;\">Double stitching on edges with polyester tape is for extra reinforcement. This is what makes it durable for your active dog.</span></p>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">Features:</b></p>\n<ul data-mce-fragment=\"1\">\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Cuddle and fetch toy with squeaker inside</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Soft, textured and durable</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Perfect cuddle and nap partner</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made of poly sherpa material</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Recycled polyfill inside</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Double stitched on the edges</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Polyester tape for reinforcement</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">100% fun</span></li>\n</ul>\n<ul data-mce-fragment=\"1\"></ul>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">Wash Care: </b>Hand wash with cold or room temperature water. Air dry in shade. Do not tumble dry.</p>\n<p data-mce-fragment=\"1\"><b>DD Reminder: </b><span style=\"font-weight: 400;\">Your pet deserves some ‘me time’. Let them enjoy a nap with their new buddy from the wild.</span></p>",
