  "description": "<p><span style=\"font-weight: 400;\">The ultimate toy for your tough chewer, Dash Dog Dumbbell chew toy is here for a fun time. It’s strong, it is durable and did we mention - it’s SO much fun.</span></p>\n<p>Your dog can keep gnawing on it as it is absolutely safe too. Textured surface removes plaque and tartar and helps your dog unwind and relieve stress.<br></p>\n<p>Bored in the house? Dash outside, double it as a fetch toy and just chase fun.<br></p>\n<p><strong>Features:</strong></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Non-toxic chew and fetch toy for dogs</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Innovated for tough chewers</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Strong, durable and long lasting</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made of natural biodegradable rubber</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Perfect for chewing and gnawing</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Improves dental hygiene</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">100% fun</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Size: 16 x 6.6 x 6.6cm / 6.2 x 2.5 x 2.5 inch</span></li>\n</ul>\n<p><strong>Wash Care: </strong>Do not wash the toy in dishwashing gel. Instead, soak it in plain water and dry it well.</p>\n<p><span style=\"font-weight: 400;\"><b>DD Reminder: </b>Your pet and you deserve some downtime together - go out and have a ball.</span></p>\n<p><span style=\"font-weight: 400;\"><b>Extra Fun: </b>Stick some dog treats with peanut butter inside the toy and watch your dog enjoy it for hours.</span></p>\n<ul></ul>",
