  "title": "Dash Dog Ton Of Fun Rope Toy For Dogs - Blue",
  "handle": "dash-dog-fun-rope-toy",
  "description": "<p><span style=\"font-weight: 400;\">Pets, let’s PLAY! Dash Dog Ton Of Fun rope toy is perfect for a game of tug. It is made by twisting yarn. The more the knots, the more your dog will enjoy - this one has 5 knots so it is 5 times the fun.</span></p>\n<p><span style=\"font-weight: 400;\">Your dog can keep gnawing on it as it is absolutely safe too. Textured surface removes plaque and tartar and helps your dog unwind and relieve stress.</span></p>\n<p><span style=\"font-weight: 400;\">Bored in the house? Dash outside, double it as a fetch toy and have a ton of fun.</span></p>\n<p><b>What’s it made of?</b></p>\n<p><span style=\"font-weight: 400;\">This toy is made of recycled yarn, which produces less carbon footprint as compared to other materials. How cool is that.</span></p>\n<p><b data-mce-fragment=\"1\">Features:</b><br></p>\n<ul data-mce-fragment=\"1\">\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Non-toxic rope and fetch toy for dogs</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Perfect for a game of tug</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Innovated for tough chewers &amp; pullers</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Strong, durable and long lasting</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Naturally dyed in blue colour</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Special twisted technique</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Improves dental hygiene</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">100% fun</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Size: 91 x 9 x 8.5 cm / 35.8 x 3.5 x 3.3 inch</span></li>\n</ul>\n<ul data-mce-fragment=\"1\"></ul>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">Wash Care: <span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Rinse or hand wash with cold or room temperature water. Air dry in shade. </span></b></p>\n<p data-mce-fragment=\"1\"><b>DD Reminder: <span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Tug on your dog’s wish to have fun. Head outside and make memories together.</span></b></p>",
