  "title": "Dash Dog Circle Printed Leash - Violet & Red",
  "handle": "dash-dog-printed-leash",
  "description": "<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Itching to run on an unexplored trail? Vibrant, strong and durable, Dash Dog Circle printed leash is perfect for your adventurous dog.</span></p>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">The padded hand loop makes it comfortable to match your dog’s pace. The sturdy, lockable hook can be attached to your dog’s matching </span><strong>DD harness or DD collar. </strong><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">The D-ring is an attachment for a poop bag dispenser - so carry that essential with ease. </span></p>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Go on, walk into the world of fun</span></p>\n<p><b>What’s more?</b></p>\n<p><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">The short handle near the hook is for times you need more control over your dog’s movement. Just grab onto it when you’re crossing the road or if there’s another dog nearby. </span></p>\n<strong>Features:</strong>\n<ul data-mce-fragment=\"1\">\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Vibrant, strong and durable dog leash</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Sturdy, lockable hook </span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Made of polyester webbing</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Padded handle for ultimate comfort</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">Short handle near the hook for quick assistance</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">D-ring attachment for poop bag dispenser</span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span>Rainbow chrome plating hardware </span></span></li>\n<li style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-style=\"font-weight: 400;\">100% fun walks</span></li>\n</ul>\n<p><strong>Wash Care: </strong>Gently hand wash using mild detergent. Air dry in shade.</p>\n<p><b>DD Reminder: <span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Safety first for all things fun! Make sure the leash is securely attached before you explore the great outdoors.</span></b></p>\n<style type=\"text/css\"><!--\ntd {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}\n--></style>",
