  "description": "<div>\n<p><i><span style=\"font-weight: 400;\">This winter, explore the roads not taken with style!</span></i></p>\n<p><span style=\"font-weight: 400;\">Double the warmth, triple the fun! Dash Dog Outdoor Dog Jacket is a must-have for winter adventures. Made of 100% high-performance polyester fabric, the jacket is lightweight and easy to move in. The 100% waterproof fabric with reflective tape at the back makes it functional to beat the mist and the dark. The best part? The jacket has an opening for a leash and a velcro flap which allows for better adjustability.</span></p>\n<p><b>Features:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Shell is made of polyester</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Lined with poly velvet for a soft feel</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Reflective tape at back for visibility in the dark</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">100% Waterproof</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Velcro fastening for the perfect fit</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Easy to slip on and move in</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Soft, warm and comfortable</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Opening for leash</span></li>\n</ul>\n<p><b>Wash Care:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Hand wash separately in cold water with mild detergent</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Fasten the velcro during the wash</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not tumble dry</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not wring</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Hang dry in shade</span></li>\n</ul>\n<ul></ul>\n<ul></ul>\n<ul></ul>\n</div>\n<ul></ul>",
