  "handle": "dash-dog-vertical-pace-6-way-leash",
  "description": "<p>6 ways to have fun on walks, Dash Dog Vertical Pace 6 Way Leash adjusts to your dog’s style of walking and is also perfect if you are walking 2 dogs at once.  It has a sturdy, lockable hook that can be attached to your dog’s matching <strong>DD harness or DD collar.</strong></p>\n<p><strong>You can use it as:</strong></p>\n<ul>\n<li>Short leash</li>\n<li>Medium leash</li>\n<li>Shoulder leash</li>\n<li>Long leash</li>\n<li>Double leash</li>\n<li>Hands-free leash</li>\n</ul>\n<p>Go on, walk into the world of fun</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Strong &amp; lightweight dog leash</li>\n<li>Use in 6 different ways</li>\n<li>Walk two dogs at once</li>\n<li>Sturdy, lockable hook</li>\n<li>Made of polyester webbing</li>\n<li>Easily attach to any DD harness or DD collar</li>\n<li>Rainbow chrome plating hardware</li>\n<li>100% fun walks</li>\n</ul>\n<p><strong>Wash Care: </strong>Gently hand wash using mild detergent. Air dry in shade.</p>\n<p><strong>DD Reminder: </strong>Safety first for all things fun! Make sure the leash is securely attached before you explore the great outdoors.</p>\n<style type=\"text/css\"><!--\ntd {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}\n--></style>",
